import math
from Crypto.Util.number import *

flag = b"COMPFEST17{REDACTED}"

p = getPrime(512)
q = getPrime(512)
n = p*q

e1 = getPrime(128)
e2 = getPrime(128)

o1 = pow(p + 5*q, e1, n)
o2 = pow(2*p - 3*q, e2, n)

m = bytes_to_long(flag)
ct = pow(m*o1*o2, 65537, n)

print(f"n = {n}")
print(f"o1 = {o1}")
print(f"o2 = {o2}")
print(f"e1 = {e1}")
print(f"e2 = {e2}")
print(f"ct = {ct}")

